function App() {
  const [userData, setUserData] = useState({});

  const userIn = (obj) => {
    setUserData(obj);
  };

  return (
    <div className="App wrapper">
    <Navbar
      bg="light"
      className="navbar shadow-sm p-3 mb-5 bg-white rounded"
      expand
    >
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <input
          type="text"
          onChange={(e) => {
            const newTerm = e.target.value;
            setSearchTerm(newTerm);
            searchproject(newTerm);
          }}
        />
        <button
          onClick={() => {
            searchproject(searchTerm);
          }}
        >
          search
        </button>
        <Nav className="ml-auto" navbar>
          <Nav.Link
            onClick={() => {
              navigate("/profile");
            }}
          >
            Profile
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
      <BrowserRouter>
        <Routes>
            <Route path="/" element={<Login userIn={userIn} />} />
            <Route path="/signup" element={<SignUp />} />
            <Route path="/allprojects" element={<Allprojects />} />
            <Route path="/allproject/oneproject" element={<OneProject />} />
            <Route
              path="/myprojects"
              element={<Myprojects userData={userData} />}
            />
            <Route path="/myprojects/addproject" element={<Addproject />} />
            <Route
              path="/myprojects/updateproject"
              element={<Updateproject />}
            />
            <Route path="/profile" element={<Profile userData={userData} />} />
            <Route path="/profile/updateprofile" element={<UpdateProfile />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
